@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.filestube.com") {
#month_trends, #ac_form + * + DIV[style="margin-top:12px;margin-left:-30px;"], 
.content + DIV + BR + BR + P[align="center"] + BR + P[align="center"],
#ac_form + DIV[style="margin-top:20px;margin-left:-80px"], .fb_image,
.related_cols, .linkbox, #newresult > DIV[style="width:99%;"],
.logo_sub + * + * + * > [href="http://www.filestube.com/submit.html"] > B, #fb-root, .boxpromo, #disqus_thread, .newcomm + #recent,
.sharebox, .file_details_title + * + .newcomm, #top_options, .logo img, .logo_sub img, 
.detend, .new_f_brd > H3[style="font-size:18px;margin:0;padding:10px 0 10px 70px;"],
A[href^="/rss.rss?q="], IMG[src="http://static.filestube.com/files/images/alert_small3.gif"],
.advancedn, .advancedsearcha, .toggle_left + .left, 
*[style="float:left;width:640px;padding-top:5px;margin-right:10px;"] > .dotter {
display:none !important;}

.content {
background-image:url("data:image/png;base64,") !important;
background-repeat:repeat-x !important;
background-position:top left !important;}

DIV[style="float:left;width:640px;padding-top:5px;margin-right:10px;"] {
padding-top:0px !important;
margin-top:-30px !important;}

.toggle_left {
width:13px !important;
height:13px !important;
overflow:hidden !important;}

.gobut {
background-image:url(data:image/jpeg;base64,) !important;
font-size:0px !important;}

.gobut {
background-position:top left !important;}

#copy_paste_links {
border:0px solid !important;
box-shadow: 0px 0px 5px rgba(0,0,0,.2) !important;
border-radius:3px !important;}

A[class*="hosting_"], #js_alt_options {
background:none !important;
border:0px !important;}

#js_alt_options {
float:right !important;
margin-top:12px !important;
margin-right:20px !important;}

B[style="color:#943100;font-size:12px;"] {
color:#666 !important;}

#ac_results.ac_res {
top:207px !important;
left:523px !important;}

.logo_sub + * + #ac_results {
top:57px !important;
left:172px !important;}

.new_f_brd, DIV[style="background-color: #E0F2FC; padding: 10px; margin-top:10px; margin-bottom:10px;"] {
background-color:#f2f7fa !important;
background-image:none !important;
border-radius:3px !important;}

.book_sub[style="width:970px;padding:10px;float:left;"] {
background-color:#e4f7fb !important;
border:1px solid #bae5ee !important;}

.book_sub[style="width:970px;border-bottom:0px;padding:1px 10px 2px;float:left;"] {
padding:5px 0px 0px 6px !important;
border:0px solid !important;
background:none !important;
position:absolute !important;
top:87px !important;
height:20px !important;
z-index:1 !important;}

IMG[style="float:left;position:relative;top:3px;"] {
z-index:0 !important;}

#ac_form INPUT[class="BUTTON"], INPUT[class="BUTTON"]:hover {
outline: none;
background: -moz-linear-gradient(center top,rgba(255, 255, 255, .98) 0%,rgba(255, 255, 255, .94) 100%) !important;;/* FF3.6 */
border-radius:0px !important;
color:#777777 !important;
-moz-appearance:none !important;
border:0px solid !important;
font-size:15px;
position:relative !important;
top:1px !important;
margin-left:-3px !important;
height:34px !important;
padding:5px 14px !important;
text-decoration:none;
text-shadow:1px 1px 0px #ffffff;}

DIV[style="margin-bottom: 15px;"] {
opacity:0 !important;}

a {
color:#3d6c91 !important;}

a:visited {
color:#666 !important;}

#d_abuse_button, .details_button {
color:#000 !important;
margin-right:0px !important;
border-right:0px !important;}

.dotter H2 {
font-family:"Segoe UI" !important;
font-weight: lighter;}

.logo:after {
content:url(http://i44.tinypic.com/2z8dphl.png) !important;
display:block !important;}

.logo_sub:after {
content:url("data:image/png;base64,") !important;
display:block !important;
margin-left:-20px !important;
margin-top:-6px !important;}

#ac_form > .BUTTON {
font-size:12px !important;}

#ac_q {
box-shadow: 0px 1px 0px rgba(255, 255, 255, 0.15), 0px 2px 4px rgba(0, 0, 0, 0.15) inset, 0px 0px 12px rgba(255, 255, 255, 0.1);
border-radius:3px !important;
border-top-right-radius:0px !important;
border-bottom-right-radius:0px !important;
-moz-appearance:none !important;
border:0px solid #B9B9B9 !important;
height:30px !important;
font-family:"Segoe UI Light" !important;
font-size:15px !important;
padding-left:5px !important;
color:#333 !important;}

.logo[style="height:103px;"] + * #ac_q {
height:32px !important;
font-size:15px !important;
padding-left:5px !important;
margin-top:1px !important;
margin-left:85px !important;
margin-right:2px !important;}

SELECT[name="select"] {
float:right !important;
font-size:10px !important;
height:18px !important;
width:74px !important;
position:relative !important;
right:130px !important;
top:1px !important;
text-transform:uppercase !important;}

.logo[style="height:103px;"] + * SELECT[name="select"] {
right:176px !important;}

.logo_sub + * > SELECT[name="select"] {
right:94px !important;}

.book_sub SELECT[name="select"] {
right:55px !important;}

.logo {
margin-bottom:30px !important;
padding-right:70px !important;}

.logo_sub {
padding-right:30px !important;
padding-top:2px !important;
margin-bottom:20px !important;}

* {
font-family:Segoe UI !important;}
}
